function setWalletMax(uint8 percentage) public {
    require(percentage == uint8(percentage), "Invalid percentage value");
    require(msg.sender == owner, "Caller is not the owner");

    // Ensure the calculation does not overflow
    require(
        totalSupply > 0 && 
        percentage <= (type(uint256).max / totalSupply),
        "Percentage calculation overflow"
    );

    // Set the maximum wallet limit as a percentage of the total supply
    _walletMAX = (totalSupply * percentage) / 100;
}

